import React from "react";

import MealsImg from "../../assets/meals.jpg";
import classes from "./Header.module.css";

const Header = (props) => {
  return (
    <>
      <header className={classes.Header}>
        <h1> ReactMeals </h1>
        <button> Cart </button>
      </header>
      <div className={classes.main_image}>
        <img src={MealsImg} />
      </div>
    </>
  );
};

export default Header;
